import React from 'react';
import Card from './Card';

const CardList = ({ fish,region }) => {
  return (
    <div>
      {
        fish.map((item, i) => {
          return (
            <Card
              key={i}
              id={i}
              name={fish[i][1].name['name-CNzh']}
              price={fish[i][1].price}
              time={fish[i][1].availability.time}
              month={fish[i][1].availability[region]}
              region={region}
              />
          );
        })
      }
    </div>
  );
}

export default CardList;
